import { InputNumber, InputText } from "primereact";
import React from "react";

export const FormsEmployee = () => {
  return (
    <React.Fragment>
      <h1>Form Employee</h1>
      <div>
        <form>
          <div>
            <span className="p-float-label">
              <InputNumber
                inputId="currency-us"
                value={12}
                mode="currency"
                currency="USD"
                locale="en-US"
              />
              <label htmlFor="username">Salary</label>
            </span>
          </div>
        </form>
      </div>
    </React.Fragment>
  );
};
